import React, { Component } from 'react';
import './App.css';
import {Spring} from 'react-spring/renderprops'






class App extends Component {







  render(){




    return(


      <Spring
      from={{ opacity: 0 }}
      to={{ opacity: 1 }}>
      {props => <div style={props}>hello</div>}
    </Spring>
    );
  }
}

export default App;
